import Footer  from './components/Footer';
import Home  from './components/Home';
import People  from './components/People';

function App() {
  return (
    <div className="App">

<Header />

    <BrowserRouter>
    <Routes>



    <Route path="/" element={<App />}>
        <Route index element={<Home />} />

          <Route path="teams" element={<People />}>


        </Route>
      </Route>

      </Routes>
        </BrowserRouter>

        <Footer />
    </div>
  );
}

export default App;
